import React from 'react';
import "./Chat.css";

function Chat(props) {
    const { chat = [], actuser } = props;

    return (
        <div className="message-left">
            {chat?.map((msg, index) => (
                <div key={index}>
                    <h6>{msg.sender}</h6>
                    <p>{msg.text}</p>
                </div>
            ))}
        </div>
    );
}

export default Chat;
